import React from 'react';
import "./styles.scss";

export class Payload extends React.Component {
    constructor(){
        super();
        this.state={
            clickBool: false
        }
    }
    showPayloads = () =>{
        this.setState({
            clickBool: !this.state.clickBool
        })
    }
    render() {
        //console.log(this.state.payloads);
        const payloadMap = this.props.payloads.map((payload, index) => {
            return (<li key={"payload " + index}>
                <dl className="payloadItem">
                    <dt className="payloadTitle">ID:</dt> <dd className="payloadDesc">{payload.payload_id}</dd>
                    <dt className="payloadTitle">Type:</dt> <dd className="payloadDesc">{payload.payload_type}</dd>
                    {payload.nationality !== undefined && <> <dt className="payloadTitle">Nationality:</dt> <dd className="payloadDesc">{payload.nationality}</dd></>}
                </dl>
            </li>
            );
        })
        return (
            <div className="payloadList">
                <h4 className="payloadHeader">Payloads:</h4>
                <button onClick={this.showPayloads}>Show Payloads</button>
                <ol>
                    {clickBool===true && payloadMap}
                </ol>
            </div>
        )
    }
}
